// Create cross browser requestAnimationFrame method:
window.requestAnimationFrame = window.requestAnimationFrame
                               || window.mozRequestAnimationFrame
                               || window.webkitRequestAnimationFrame
                               || window.msRequestAnimationFrame
                               || function(f){setTimeout(f, 1000/60)}

var scrollheight = document.body.scrollHeight; 	// height of entire document
var windowheight = window.innerHeight;		// height of browser window
var windowwidth  = window.innerWidth; 		// width of browser window

//var rotateDeg = 100 * (scrollheight - 0.3) + 30;

function parallaxbubbles(){
	var scrolltop      = window.pageYOffset; // get number of pixels document has scrolled vertically
	var scrollamount   = (scrolltop / (scrollheight-windowheight)) * 100; // get amount scrolled (in %)
	var scrollamount1  = (scrolltop / (scrollheight-windowheight)) * 200; // get amount scrolled (in %)

	//container.style.left = 'calc(50% - ' + vytw*0.5 + 'px)';
	//container.style.left = 'calc(50% - 630px)';

	if (window.innerWidth > 1300) {container.style.left = 'calc(50% - ' + window.innerWidth*0.5 +'px'};

	var rotate = 0.1 * scrolltop;
	if(rotate > 90) {rotate = 90};

	vytis.style.transform = 'rotateX(' + rotate + 'deg)' + ' scale('+ (1 + (0.01 * scrolltop)) + ')';
	vytisimg.style.transform   = 'rotateX(' + rotate + 'deg)' + ' scale('+ (1 + (0.01 * scrolltop)) + ')';

	vytis.style.height = window.innerWidth * 0.6 + 'px';
	if (window.innerWidth > 1300) {vytis.style.height = 780 + 'px'};
	if (window.innerWidth < 900)  {vytis.style.height = 540 + 'px'};

	//container.style.left = 'calc(50% - ' + windowwidth + 'px)';
	//vytis.style.opacity = scrollamount * 0.5;

	flag_4.style.opacity = scrollamount * 0.01;
	flag_5.style.opacity = scrollamount * 0.01;
	flag.style.height   = scrollamount * 0.3 + 10 + '%';
	flag_1.style.height = scrollamount * 0.3 + 14 + '%';
	flag_2.style.height = scrollamount * 0.3 + 18 + '%';
	flag_3.style.height = scrollamount * 0.3 + 22 + '%';
	flag_4.style.height = scrollamount * 0.3 + 26 + '%';
	flag_5.style.height = scrollamount * 0.3 + 30 + '%';
	vytisimg.style.opacity = 1 - scrollamount * 0.01;
    	statusSpan.innerHTML = scrollheight + ' ' + windowheight + ' ' + windowwidth;
	status.style.opacity   = 1 - scrollamount * 0.01;
}

if (!isiOS){
	window.addEventListener('scroll', function(){ // on page scroll
		requestAnimationFrame(parallaxbubbles) // call parallaxbubbles() on next available screen repaint
	}, false)
	
	window.addEventListener('resize', function(){ // on window resize
		var scrollamount = (scrolltop / (scrollheight-windowheight)) * 100 // get amount scrolled (in %)

	}, false)
}
